К основным DRY-элементам программируемых конфигурационных языков, можно отнести: переменные; арифметические операции; функции в математическом смысле; ветвления; операции построения многоэлементных массивов и иных составных объектов; операции импорта сторонних модулей; Jsonnet является расширенным вариантом JSON и представляет собой Тьюринг-полный конфигурационный язык с динамической типизацией. Пример описания данных на Jsonnet: local makeUser(user) = { local home = std.format("/home/%s", user), local privateKey = std.format("%s/.ssh/id_ed25519", home), local publicKey = std.format("%s.pub", privateKey), home: home, privateKey: privateKey, publicKey: publicKey
}; [ makeUser("bill"), makeUser("jane")
] Результат преобразования в JSON: [ { "home": "/home/bill", "privateKey": "/home/bill/.ssh/id_ed25519", "publicKey": "/home/bill/.ssh/id_ed25519.pub" }, { "home": "/home/jane", "privateKey": "/home/jane/.ssh/id_ed25519", "publicKey": "/home/jane/.ssh/id_ed25519.pub" }
] Еще одним программируемым конфигурационным языком является Dhall . Этот язык со статической типизацией, основанный на принципах функционального программирования. Авторы определяют Dhall, как JSON + функции + типы + импорты. Важной особенностью Dhall является тот факт, что это Тьюринг-неполный язык. В Dhall имеется режим нормализации представления, при котором все языковые абстракции разворачиваются и результат представляет собой уровень представления JSON или YAML. Пример описания данных на Dhall: let makeUser = \(user : Text) -> let home = "/home/${user}" let privateKey = "${home}/.ssh/id_ed25519" let publicKey = "${privateKey}.pub" in { home = home , privateKey = privateKey , publicKey = publicKey } in [ makeUser "bill" , makeUser "jane" ]

