Очевидным способом объединения документации и программного кода является подробное комментирование программного кода. При внесении изменений в программу имеет возможность сразу же обновить документирующие поведение программы комментарии в коде. Существуют инструменты, позволяющие автоматически извлечь из файла программы специальным образом оформленные комментарии и оформить результат в виде справочной документации по программному модулю. Примеры генераторов документации: Javadoc для языка Java. Doxygen для C++ и некоторых других языков. Расширения для системы Sphinx, поддерживающие целый ряд языков. Ниже показан пример программы на языке C со специальными комментариями, поддерживаемыми системой Doxygen. Обратите внимание на специальные ключевые слова \file, \brief и \param: /// \file main.cpp
